import React from "react";
import { Navbar, Nav, Form, FormControl, Button, Image } from 'react-bootstrap';
import './Header.css';
import logo from '../../images/website-logo.png';
import { Link } from "react-router-dom";
const Header = () => {
  const handleBar = (event) => {
      console.log(event.target.name, event.target.value)
  }  
  return (
    <div className="sticky-top">
      <Navbar expand="lg" className=" bg-color">
       <Link to="/home">
        <Navbar.Brand>
                <Image src={logo} className="img-fluid" />
                <span className="ml-2 fw-400">Sports World</span>
            </Navbar.Brand>
       </Link>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
           
          </Nav>
          <Form inline>
            <FormControl type="text" name="name"  placeholder="Search" className="mr-sm-2" />
            <Button variant="outline-success" onBlur={handleBar}>Search</Button>
          </Form>
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
};

export default Header;
